import React from "react";
import { Menulist } from "./Menulist";
import  "./Navbar.css";
function NavBar  () {  
    
    const menulist = Menulist.map((data,index)=>{
        return(
            
               <li index={index}>
                   <a href={data.url}>{data.title}</a>
               </li>
           
        );
       
    })
  return (
      <nav>
           <div className="logo">
               VPN<font>LAB</font>
               ZXdgvbhjk,jhngfdagshdjf
            </div>
               <ul> {menulist}</ul>
          
      </nav>
    
  );
}

 export default NavBar;
